import React from "react";

const VideoConference = ({ children }) => {
  return (
    <div className="video-conference-layout" style={{ 
      height: "100vh", 
      width: "100vw", 
      overflow: "hidden",
      backgroundColor: "#1a1a1a"
    }}>
      {children}
    </div>
  );
};

export default VideoConference;
